        iCurvePool pool = iCurvePool(_pool);
        uint256 N_COINS = 3;
        for (uint256 i = 0; i < N_COINS; i++) {
            address ai = pool.underlying_coins(i);
            if (ai == USDC) {
                return balance;
            }
        }
        revert("can't find addresses of coins 1");
    }

